import logo from "./logo.svg";
import "./App.css";
import Datas from "./data.json";
import Infos from "./example_data.json";

function App() {
  const info = Infos.map((Info) => (
    <ul key={Info.id}>
      <li>
        <h1>Name {Info.name}</h1>
      </li>
      <li>
        <h3>Categories : {Info.categories}</h3>
      </li>
      <li>
        <h3>Image</h3>
        <img src={Info.profile_image_url} alt={"logo"} width="100" />
      </li>
      <li>
        {" "}
        {Info.images.forEach((item) => {
          <h6>{item}</h6>;
        })}
      </li>

      <li>
        <h4>mannul</h4>
        <img src={Info.images[0]} alt={"logo1"} width="100" />
      </li>
      <li>
        <img src={Info.images[1]} alt={"logo2"} width="100" />
      </li>
      <li>
        <img src={Info.images[2]} alt={"logo3"} width="100" />
      </li>
    </ul>
  ));
  const test = Datas.map((data) => (
    <ul key={data.id}>
      <li> name{data.color}</li>
      <li>{data.value}</li>
      <br />
    </ul>
  ));

  return (
    <div className="App">
      <h1>APP</h1>
      {info}
    </div>
  );
}

export default App;
